let userMarker;

function locateUser(showMessage = true) {
    if (!navigator.geolocation) {
        alert(" Le GPS n'est pas support par ce navigateur.");
        return;
    }

    navigator.geolocation.getCurrentPosition(
        function(position) {
            const lat = position.coords.latitude;
            const lng = position.coords.longitude;

            // Supprimer l'ancien marqueur si existe
            if (userMarker) map_bdb6730597835266f38b781ef766530a.removeLayer(userMarker);

            // Ajouter le marqueur du nouveau point
            userMarker = L.marker([lat, lng])
                .addTo(map_bdb6730597835266f38b781ef766530a)
                .bindPopup(" Vous tes ici").openPopup();

            // Centrer la carte sur la position
            map_bdb6730597835266f38b781ef766530a.setView([lat, lng], 15);

            if (showMessage) {
                console.log(" Position mise  jour !");
            }
        },
        function(error) {
            alert(" Erreur de golocalisation : " + error.message);
        },
        { enableHighAccuracy: true, timeout: 10000 }
    );
}

// === Dmarrage automatique du GPS au chargement ===
locateUser(false);

// === Bouton "Actualiser ma position" en bas ===
const gpsButton = L.DomUtil.create('button', 'gps-refresh-button');

    boxShadow: '0 2px 6px rgba(0,0,0,0.3)',
    cursor: 'pointer',
    zIndex: '9999'
});
gpsButton.onclick = () => locateUser();
document.body.appendChild(gpsButton);
